import React from 'react';
import './index.css';

const App= (props) => {
  return (
	<div id='App'>
		<h1 className="text-3xl font-bold underline">
			Hello world!
		</h1>
		<div>
			<button className="btn">Hello daisyUI</button>
		</div>
	</div>

  );
}

export default App;
